import React, { Component } from 'react';

class Detail extends Component {

    render() {
        return (
            <div>
                <h1>detail</h1>
                
                <h1>{this.props.location.state.title}</h1>
                <h2>{this.props.location.state.content}</h2>
            </div>

            
        );
    }
}

export default Detail;
